&lt;p&gt;Online Farm Trials is part of an interoperable web-GIS maintained by Federation University Australia. The Online Farm Trials (OFT) project is funded and supported by the &lt;a href=&quot;http://www.grdc.com.au/&quot;&gt;Grains Research and Development Corporation (GRDC)&lt;/a&gt;, and was initiated in 2013 with the aim of using the latest technology to improve access to, and adoption of, grains industry research data and information. Federation University Australia's &lt;a href=&quot;http://www.cerdi.edu.au/&quot;&gt;Centre for eResearch and Digital Innovation&lt;/a&gt; is leading the project to develop and deliver the OFT Trial Explorer, Report Library and other trial research resources. The project has a strong collaborative approach, working with a range of crop research groups, industry experts and grain industry organisations to ensure the outcomes are highly relevant, practical
                and beneficial.&lt;/p&gt; &lt;p&gt;The Federation University Australia Spatial Online Farm Trials database includes:&lt;/p&gt; &lt;ul&gt; &lt;li&gt;An accessible online digital library of national farm trial research reports and documents.&lt;/li&gt; &lt;li&gt;Direct online access to trial research data in digital form with download capacity.&lt;/li&gt; &lt;li&gt;Online analytical/decision tools for growers, agronomists and researchers.&lt;/li&gt; &lt;li&gt;Linking of other sources of relevant data and information with trial research through interoperable systems.&lt;/li&gt; &lt;li&gt;Increased networking and collaboration on cropping issues and farm trial research.&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;The principle objective of the project is to help growers improve productivity and sustainability of their farm enterprise through improved access to
                trial research knowledge.&lt;/p&gt;
